/*
Title: ProfileAdmin.js
Author: Joel Harawa
Purpose: Display the profile page to the admin
*/
import AdminProfile from "../components/AdminProfile";
import AdminNavbar from "../components/AdminNavbar";

const ProfileAdmin = () => {
    
    return (
        <>
            <AdminNavbar/>
            <AdminProfile/>
        </>
    )
}

export default ProfileAdmin;
